import React, { Component } from "react";
import Weather from "./Weather";

class Home extends Component {
  state = {
    city: 2673730,
  };
  render() {
    const { city } = this.state;
    return (
      <React.Fragment>
        <h1>Home</h1>
        <Weather targetCity={city} />
      </React.Fragment>
    );
  }
}

export default Home;
